mm_word myEventHandler( mm_word msg, mm_word param ) {

	switch( msg ) {
	case MMCB_SONGMESSAGE:	// process song messages
		if( (MODE==0||MODE==3) && unpausetimer==0 )createeventanim(param);
        break;
    case MMCB_SONGFINISHED:	// process song finish message (only triggered in songs played with MM_PLAY_ONCE)
		break;
    }
	return 0;
}
void createeventanim(s8 number)
{
	if(theoptions[6] != 0)
	{
		int i=0;
		for(i=0;i<14;i++)
		{
			if(!eventsprite[i].activated)
			{
				eventsprite[i].rotset = i+2;
				eventsprite[i+14].rotset = i+2;
				eventsprite[i+28].rotset = i+2;
				eventsprite[i+42].rotset = i+2;
				eventsprite[i+56].rotset = i+2;
				int a=0;
				for(a=0;a<theoptions[6];a++)
				{
					eventsprite[i+a*14].gfx = oamAllocateGfx(&oamMain, SpriteSize_16x16,SpriteColorFormat_256Color);//make room for the sprite
					gettilesprite(eventsprite[i+a*14].gfx,number+9,16,(u8*)ballTiles);
					eventsprite[i+a*14].activated=true;
					eventsprite[i+a*14].angle = (rand() % 256<<8);
					if(rand() % 1 == 1)	eventsprite[i+a*14].angdirection = 1;
					else eventsprite[i+a*14].angdirection = -1;
					eventsprite[i+a*14].direction.x = (rand() % 8 - 4) * 3;
					eventsprite[i+a*14].direction.y = (rand() % 8 - 4) * 3;
					eventsprite[i+a*14].size = 128;
					eventsprite[i+a*14].position.x = 112;
					eventsprite[i+a*14].position.y = 80;
				}
				i=40;
			}
		}
	}
}

