s32 getTile(s32 tilex,s32 tiley)
{
	if(tilex<=0 || tilex>128 || tiley<=0 || tiley>64) return 1;
	return currentmap[tilex+(tiley*128)];
}
void changeTile(s32 tilex,s32 tiley,int tilenumber)
{
	if(currentmap[tilex+(tiley*128)]!=tilenumber&&tilex>1&&tiley>1&&tilex<126&&tiley<62)
	{
		if(currentmap[tilex+(tiley*128)]==TILEDEBUT) {initX=-2; initY=-2;}
		if(currentmap[tilex+(tiley*128)]==TILETELESORTIE) {teleX=-2; teleY=-2;}
		if(currentmap[tilex+(tiley*128)]==TILETELE2SORTIE) {tele2X=-2; tele2Y=-2;}
		if(tilenumber==TILEDEBUT)
		{
			currentmap[((initX+12)/8)+((initY+16)/8)*128]=0;
			if(initX==-2) currentmap[((initX+12)/8)+((initY+16)/8)*128]=1;
			initX=tilex*8 - 12; initY=tiley*8 - 16;
		}
		if(tilenumber==TILETELESORTIE)
		{
			if(teleX!=-1&&teleY!=-1) currentmap[((teleX+12)/8)+((teleY+16)/8)*128]=0;
			if(teleX==-2) currentmap[((teleX+12)/8)+((teleY+16)/8)*128]=1;
			teleX=tilex*8 - 12; teleY=tiley*8 - 16;
		}
		if(tilenumber==TILETELE2SORTIE)
		{
			if(tele2X!=-1&&tele2Y!=-1) currentmap[((tele2X+12)/8)+((tele2Y+16)/8)*128]=0;
			if(tele2X==-2) currentmap[((tele2X+12)/8)+((tele2Y+16)/8)*128]=1;
			tele2X=tilex*8 - 12; tele2Y=tiley*8 - 16;
		}
		currentmap[tilex+(tiley*128)] = tilenumber;
		if(MODE==1 && !achv[14].completed) tracker[4]++;
	}
}
void flushDC()
{
	DC_FlushRange(currentmap,sizeof(currentmap));
	dmaCopy(currentmap, bgGetMapPtr(bg2),  sizeof(currentmap));
	dmaCopy(currentmap, bgGetMapPtr(bgsub3),  sizeof(currentmap));
}
s8 cursor = 0;
s16 fileselector(char loc[256],char text[256],char contains[20])
{
	int a=0;
	DIR *pdir;
	struct dirent *pent;
	struct stat statbuf;
	char tempchar[256] = "aerinjgrb";

	pdir=opendir(loc);

	a=0;
	while(a<300)
	{
		strncpy(filelist[a].text,tempchar,strlen(tempchar)); // Place un temporaire pour détecter si c'est un "vide"
		a++;
	}

	if (pdir)
	{
		a=0;
		while ((pent=readdir(pdir))!=NULL)
		{
	    	stat(pent->d_name,&statbuf);
			if(pent->d_name!=NULL)
			{
				strcpy(filelist[a].text,pent->d_name); // Place le nom dans l'index.
				a++;
			}
		}
		closedir(pdir);
		a=0;
		while (a<300)
		{
				if(!strstr(filelist[a].text,contains))
				{
					int i=a;
					while(i<299)
					{
						if(i>0) strcpy(filelist[i].text,filelist[i+1].text);
						i++;
					}
				}
				a++;
		}
		a=0;
		int maximum = 0;
		while(a<300)
		{
			if(strcmp(filelist[a].text,tempchar)) a=a;
			else
			{
				maximum=a;
				a=400;
			}
			a++;
		}
		if(maximum>=30) achv[11].activated = true;
		while(1) // Map Selecteur
		{
			scanKeys();
			if(keysDown() & KEY_DOWN || keysDown() & KEY_B) cursor++;
			if(keysDown() & KEY_UP || keysDown() & KEY_X) cursor--;
			if(cursor<0) cursor=maximum-1;
			if(cursor>=maximum) cursor=0;
			iprintf("\n%s\n\n",text);

			int tempcur = 0,i = 0;
			for(i=9;i>-1;i--)
			{
				tempcur=cursor-i+5;
				if(tempcur<0) tempcur += maximum;
				if(tempcur>=maximum) tempcur -= maximum;
				if(tempcur<0||tempcur>=maximum) tempcur=0;
				if(i==5) iprintf("\n->%d :%s",tempcur,filelist[tempcur].text);
				else iprintf("\n  %d :%s",tempcur,filelist[tempcur].text);
			}
			swiWaitForVBlank();
			iprintf("\x1b[2J");
			if(keysDown() & KEY_TOUCH)
			{
				if(cursor==0) return -10;
				else return cursor;
			}
		}
	}
	else
	{
		return -10;
	}
}
