	if(MODE==2)
	{
		musicindex=0;
		changemusic();
	}
	mmSetModuleVolume(theoptions[4]*256);
	mmSetModuleTempo(1024);

	reloadoptions();
	int z;
	for(z=0;z<15;z++) oldtracker[z] = tracker[z];
	for(z=0;z<50;z++) oldachv[z] = achv[z];
