s16 achvtimer;
int limittext;
const char* achvtext;
void updateachievements()
{
	int z;
	if(!achvcurrent.activated)
	{
		for(z=0;z<50;z++)
		{
			if( achv[z].activated && !achv[z].completed )
			{
				achvcurrent = achv[z];
				achv[z].completed=true;
				achv[z].activated=false;
				achvtext = lang[ACHV+z];
				achvtimer=0;
				limittext=0;
				achvpos.x = 0;
				achvpos.y = 225;
				break;
			}
		}
	}
	else
	{
		achvtimer++;
		if(achvtimer<22) achvpos.y -= 3;
		if(achvtimer>=258) achvpos.y += 3;
		if(achvtimer>15 && limittext<28 && achvtimer<200) limittext++;
		if(achvtimer>200 && limittext>0) limittext--;

		oamRotateScale(&oamMain,1,0,128,128);
		oamSet(&oamMain,25,achvpos.x,achvpos.y,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,achvcurrent.gfx,1,true,false,false,false,false);
		consoleSelect(&achievementScreen);
		consoleClear();
		consoleSetWindow(&achievementScreen,4,23-(limittext/28),limittext,5);
		BG_PALETTE[255] = RGB15(31,31,31);
		printf("%s",achvtext);
		if(achvtimer>=270)
		{
			oamSet(&oamMain,25,achvpos.x,achvpos.y,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,achvcurrent.gfx,1,true,true,false,false,false);
			consoleClear();
			achvcurrent.activated=false;
		}
		if(MODE==0||MODE==1||MODE==3) consoleSelect(&bottomScreen);
		if(MODE==2) consoleSelect(&topScreen);
	}
}

void achieve()
{
	oamRotateScale(&oamMain,1,0,256,256);
	unpausetimer=30;
	int z=0,x=0;
	for(z=0;z>-25;z -= 2)
	{
		setBrightness(3,z);
		swiWaitForVBlank();
	}
	z=0;
	int numberofachieve;
	numberofachieve=0;
	for(z=0;z<50;z++) if(achv[z].completed) numberofachieve++;
	bgShow(bg2);
	BG_PALETTE[255] = RGB15(31,31,31);
	BG_PALETTE_SUB[255] = RGB15(31,31,31);
	consoleClear();
	int ok=0;
	int posX = -16,posY = -16;
	int startmode=MODE;
	lcdMainOnBottom();
	consoleSelect(&topScreen);
	printf("%s %d",lang[MAXTILES+16],numberofachieve);
	if(numberofachieve>=50) printf("\nBravo ! Congratulation ! 50 !");
	consoleSelect(&bottomScreen);
	bg2 = bgInit(3, BgType_Rotation, BgSize_R_256x256, 0,3);

	dmaCopy(achvbotTiles, bgGetGfxPtr(bg2), sizeof(achvbotTiles));
	dmaCopy(achvbotMap, bgGetMapPtr(bg2),  sizeof(achvbotMap));
	dmaCopy(achvbotPal, BG_PALETTE, sizeof(achvbotPal));

	bgHide(bgsub2);
	bgHide(bgsub3);
	for(z=0;z<127;z++) oamSet(&oamMain,z,20,20+20*z,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,NULL,0,false,true,false,false,false);
	for(z=0;z<127;z++) oamSet(&oamSub,z,20,20+20*z,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,NULL,0,false,true,false,false,false);
	oamUpdate(&oamSub);
	oamUpdate(&oamMain);
	bgUpdate();
	dmaCopy(ballPal, SPRITE_PALETTE, ballPalLen);
	brightness=-24;
	while(ok==0)
	{
		scanKeys();
		touchRead(&touch);
		if(keysDown() & KEY_START)
			ok=1;
		if(keysDown() & KEY_TOUCH)
		{
			consoleClear();
			posX=-16;
			posY=-16;
		}
		if(squaretouch(220,2,16,16)) ok=1;
		for(z=0;z<10;z++)
		{
			for(x=0;x<5;x++)
			{
				oamSet(&oamMain,10+(z+x*10),16+(z*22),24+(x*22),0,0,SpriteSize_16x16,SpriteColorFormat_256Color,achv[z+(x*10)].gfx,1,false,false,false,false,false);
				if(squaretouch(16+(z*22),24+(x*22),16,16))
				{
					consoleSelect(&bottomScreen);
					consoleClear();
					if(achv[z+(x*10)].completed) printf("\n\n\n   %s \n\n--%s",lang[ACHV+z+(x*10)],lang[ACHV+50+z+(x*10)]);
					else printf("\n\n\n   %s \n\n--???",lang[ACHV+z+(x*10)]);
					posX = 6  +(z*22);
					posY = 10 +(x*22);
				}
			}
		}
		swiWaitForVBlank();
		oamSet(&oamMain,1,220,2,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,achievementX,1,false,false,false,false,false);
		oamSet(&oamMain,2,posX,posY,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,achievementCursor,1,false,false,false,false,false);
		oamUpdate(&oamMain);
		if(brightness<0) brightness += 2;
		setBrightness(3,brightness);
	}
	for(z=0;z<127;z++) oamSet(&oamMain,z,20,20+20*z,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,NULL,0,false,true,false,false,false);
	for(z=0;z<127;z++) oamSet(&oamSub,z,20,20+20*z,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,NULL,0,false,true,false,false,false);

	for(z=0;z>-24;z--)
	{
		setBrightness(3,z);
		swiWaitForVBlank();
	}
	consoleClear();
	bgShow(bgsub3);
	BG_PALETTE[255] = RGB15(0,0,0);
	BG_PALETTE_SUB[255] = RGB15(0,0,0);


	if(MODE==0||MODE==1||MODE==3)
	{
		bg2 = bgInit(3, BgType_Rotation, BgSize_R_1024x1024, 0,3);
		consoleSelect(&bottomScreen);
		bgShow(bgsub2);
		dmaCopy(TilesTiles, bgGetGfxPtr(bg2), sizeof(TilesTiles));
		flushDC();
		dmaCopy(currentmap, bgGetMapPtr(bg2),  sizeof(currentmap));
		dmaCopy(TilesPal, BG_PALETTE, sizeof(TilesPal));

		bgSetCenter(bg2, 128, 96);
		bgSetRotateScale(bg2, angle, 1<<8, 1<<8);
		bgSetScroll(bg2, (Sprite.position.x>>8) +16, (Sprite.position.y>>8) +16);
	}
	if(MODE==1)
	{
		bgSetRotateScale(bg2, 0, 1<<8, 1<<8);
		bgSetCenter(bg2, 0, 0);
		if(zoom)
			bgSetScroll(bg2, editorX*1.17, (editorY*1.3)-2);
		else bgSetScroll(bg2, editorX, editorY);
			bgSetScroll(bgsub3,-463+editorX,-400+editorY);
	}
	if(MODE==2)
	{
		bg2 = bgInit(3, BgType_Rotation, BgSize_R_256x256, 0,3);
		consoleSelect(&topScreen);
		dmaCopy(mmbottomTiles, bgGetGfxPtr(bg2), sizeof(mmbottomTiles));
		dmaCopy(mmbottomMap, bgGetMapPtr(bg2),  sizeof(mmbottomMap));
		dmaCopy(mmbottomPal, BG_PALETTE, sizeof(mmbottomPal));
		dmaCopy(mmspritesPal, SPRITE_PALETTE, mmspritesPalLen);
	}

	while((keysHeld() & KEY_SELECT || keysHeld() & KEY_TOUCH))
	{
		scanKeys();
		touchRead(&touch);
	}
	if(startmode!=MODE) needinit = true;
	bothbrightness = -24;
	if(MODE==2) unpausetimer=0;
}
void reloadcampaign()
{
	int z=0;
	for(z=0;z<15;z++)
		{
			oamFreeGfx(&oamMain,campbuttons[z]);
			campbuttons[z] = oamAllocateGfx(&oamMain, SpriteSize_16x16,SpriteColorFormat_256Color);
			if(tracker[14]>z)
			{
				if(achv[30+z].completed) gettilesprite(campbuttons[z],2,16,(u8*)campTiles);
				else gettilesprite(campbuttons[z],1,16,(u8*)campTiles);
			}
			else if (tracker[14]==z) gettilesprite(campbuttons[z],0,16,(u8*)campTiles);
			else gettilesprite(campbuttons[z],5,16,(u8*)campTiles);
		}
}
void campaign()
{
	oamRotateScale(&oamMain,1,0,256,256);

	int z=0,x=0;
	unpausetimer=30;
	if(!campaignbool)
	{
		for(z=0;z>-25;z -= 2)
		{
			setBrightness(3,z);
			swiWaitForVBlank();
		}
	}
	bgShow(bg2);
	consoleClear();
	int ok=0;
	int posX = -16,posY = -16;
	lcdMainOnBottom();
	consoleSelect(&bottomScreen);
	bg2 = bgInit(3, BgType_Rotation, BgSize_R_256x256, 0,3);

	dmaCopy(campbotTiles, bgGetGfxPtr(bg2), sizeof(campbotTiles));
	dmaCopy(campbotMap, bgGetMapPtr(bg2),  sizeof(campbotMap));
	dmaCopy(campbotPal, BG_PALETTE, sizeof(campbotPal));

	bgHide(bgsub2);

	for(z=0;z<127;z++) oamSet(&oamMain,z,20,20+20*z,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,NULL,0,false,true,false,false,false);
	for(z=0;z<127;z++) oamSet(&oamSub,z,20,20+20*z,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,NULL,0,false,true,false,false,false);
	oamUpdate(&oamSub);
	oamUpdate(&oamMain);
	bgUpdate();
	dmaCopy(campPal, SPRITE_PALETTE, campPalLen);
	brightness=-24;
	campindex = -1;
	reloadcampaign();
	bgsub3 = bgInitSub(3, BgType_Rotation, BgSize_R_1024x1024, 2,2);
	dmaCopy(backgroundtopTiles, bgGetGfxPtr(bgsub3), sizeof(backgroundtopTiles));
	dmaCopy(backgroundtopPal, BG_PALETTE_SUB, sizeof(backgroundtopPal));
	dmaCopy(map, bgGetMapPtr(bgsub3),  sizeof(map));
	BG_PALETTE_SUB[255] = RGB15(31,31,31);
	bgHide(bgsub3);

	while(ok==0)
	{
		scanKeys();
		touchRead(&touch);
		if(keysDown() & KEY_START)
			ok=1;
		if(keysDown() & KEY_TOUCH)
		{
			consoleSelect(&bottomScreen);
			consoleClear();
			consoleSelect(&topScreen);
			posX=-16;
			posY=-16;
			bgHide(bgsub3);
		}
		if(squaretouch(220,2,16,16)) ok=1;
		for(z=0;z<5;z++)
		{
			for(x=0;x<3;x++)
			{
				oamSet(&oamMain,30+(z+x*5),16+(z*32),24+(x*32),0,0,SpriteSize_16x16,SpriteColorFormat_256Color,campbuttons[z+(x*5)],1,false,false,false,false,false);
				if(squaretouch(16+(z*32),24+(x*32),16,16) && keysDown() & KEY_TOUCH)
				{
					if(z+(x*5)==campindex && campindex<=tracker[14])
					{
						ok=1;
						MODE=3;
					}
					else campindex = z+(x*5);
					bgShow(bgsub3);
					int a=0;
					for(a=0;a<8192;a++) currentmap[a] = maps[campindex].map[a];
					dmaCopy(backgroundtopPal, BG_PALETTE_SUB, sizeof(backgroundtopPal));
					dmaCopy(currentmap, bgGetMapPtr(bgsub3),  sizeof(currentmap));
					BG_PALETTE_SUB[255] = RGB15(31,31,31);
					bgSetRotateScale(bgsub3,0,1024,1024);
					bgSetScroll(bgsub3,0,-200);
					bgUpdate();
					consoleSelect(&bottomScreen);
					consoleClear();
					printf("\n%s",lang[CAMP+campindex]);
					if(campindex>tracker[14]) printf("\n    %s",lang[OPTIONS+10]);
					posX = 6  +(z*32);
					posY = 10 +(x*32);
				}
			}
		}
		consoleSelect(&topScreen);
		consoleClear();
		printf("\x1b[2;2H1   2   3   4   5");
		printf("\x1b[6;2H6   7   8   9   10");
		printf("\x1b[10;2H11  12  13  14  15");
		swiWaitForVBlank();
		oamSet(&oamMain,1,220,2,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,campbuttons[15],1,false,false,false,false,false);
		oamSet(&oamMain,2,posX,posY,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,campbuttons[16],1,false,false,false,false,false);
		oamUpdate(&oamMain);
		if(brightness<0) brightness += 2;
		setBrightness(3,brightness);
	}
	for(z=0;z<127;z++) oamSet(&oamMain,z,20,20+20*z,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,NULL,0,false,true,false,false,false);
	for(z=0;z<127;z++) oamSet(&oamSub,z,20,20+20*z,0,0,SpriteSize_16x16,SpriteColorFormat_256Color,NULL,0,false,true,false,false,false);

	for(z=0;z>-24;z--)
	{
		setBrightness(3,z);
		swiWaitForVBlank();
	}
	consoleSelect(&topScreen);
	consoleClear();
	consoleSelect(&bottomScreen);
	consoleClear();
	bgShow(bgsub3);
	BG_PALETTE[255] = RGB15(0,0,0);
	BG_PALETTE_SUB[255] = RGB15(0,0,0);

	bgsub3 = bgInitSub(3, BgType_Rotation, BgSize_R_256x256, 2,2);
	dmaCopy(mmtopTiles, bgGetGfxPtr(bgsub3), sizeof(mmtopTiles));
	dmaCopy(mmtopMap, bgGetMapPtr(bgsub3),  sizeof(mmtopMap));
	dmaCopy(mmtopPal, BG_PALETTE_SUB, sizeof(mmtopPal));

	bg2 = bgInit(3, BgType_Rotation, BgSize_R_256x256, 0,3);
	consoleSelect(&topScreen);
	dmaCopy(mmbottomTiles, bgGetGfxPtr(bg2), sizeof(mmbottomTiles));
	dmaCopy(mmbottomMap, bgGetMapPtr(bg2),  sizeof(mmbottomMap));
	dmaCopy(mmbottomPal, BG_PALETTE, sizeof(mmbottomPal));
	dmaCopy(mmspritesPal, SPRITE_PALETTE, mmspritesPalLen);
	bothbrightness = -24;
}
